import Link from "next/link";
// import Layout from "./Layout";
import axios from "axios";

const Index = (props) => {
  return (
    <Layout title="This is Index title">
      {" "}
      Index
      <div>
        <Link href="about">
          <a>Go to about</a>
        </Link>
      </div>
      <div>
        {props.posts.map((post, index) => (
          <div key={index}>{post.name}</div>
        ))}
      </div>
    </Layout>
  );
};
